INSERT INTO `details_info` (`id`, `zh`, `en`, `active`, `zh_desc`, `en_desc`, `sortOrder`) VALUES
(1, '第三者財物損毀 ', 'Third Party Property Damage ', 1, '第三者財物損毀', 'Third Party Property Damage', 5),
(2, '第三者財物損毀 - 不記名司機', 'Third Party Property Damage - Unnamed ', 1, '第三者財物損毀 - 不記名司機自負額，當意外發生時，該司機沒有於"承保表"所列，此自負額即生效', 'Excess of Third Party Property Damage - Unnamed , would be applied if the driver have not named in the policy “schedule” when the accident.', 20),
(3, '第三者財物損毀 - 經驗不足自負額', 'Third Party Property Damage - Inexperience', 1, '第三者財物損毀 - 經驗不足自負額，當意外發生時司機持有駕駛執照少於兩年，此自負額隨即生效', 'Excess of Third Party Property Damage - Inexperience, would be applied if the driver hold a driving license less than 2 years when the accident occured.', 15),
(4, '第三者財物損毀 - 年輕', 'Third Party Property Damage - Young ', 1, '第三者財物損毀 - 年輕自負額，當意外發生時司機年齡少於25，此自負額隨即生效', 'Excess of Third Party Property Damage - Young, would be applied if the driver age is below 25 years old when the accident.', 10);
